import React from "react";
import ReactCardCarousel from "react-card-carousel";
// import "react-multi-carousel/lib/styles.css";
import RajasthanDes from "../../images/RajasthanDes.jpg";
import Rajasthan from "../../images/Rajasthan.jpg";
import "../dropdown.css";
import { Row, Col } from "react-bootstrap";

export default function Destination() {
  return (
    <>
      <div>
        <img className="DestImage" src={RajasthanDes} alt="raj"></img>
      </div>
      <Row>
        <Col>Text</Col>
        <Col>
          <div className="containerStyle">
            <ReactCardCarousel autoplay={true} autoplay_speed={2500}>
              <div className="cardStyle">First Card</div>
              <div className="cardStyle">Second Card</div>
              <div className="cardStyle">Third Card</div>
              <div className="cardStyle">Fourth Card</div>
              <div className="cardStyle">Fifth Card</div>
            </ReactCardCarousel>
          </div>
        </Col>
      </Row>
    </>
  );
}
